	and internship.internship_id = student_internship.internship_id;
    
    SELECT 5 * (DATEDIFF(now(),start_date) DIV 7) 
+ MID('0123444401233334012222340111123400012345001234550', 7 * WEEKDAY(start_date) + WEEKDAY(now()) + 1, 1) - count(*) 
into dif_result from dailylog where student_id = matricNo;
    
    
RETURN dif_result;
END ;;
