CREATE DEFINER=`root`@`localhost` PROCEDURE `dailylog_sick_leave_proc`(user_id varchar(30), selected_date date, title varchar(45), log_content longtext, img longblob)
BEGIN

	declare start_date date;
    declare end_date date;
    
SELECT 
    session_tab.session_start_date, session_tab.session_end_date
INTO start_date , end_date FROM
    session_tab,
    internship,
    student_internship
WHERE
    student_internship.student_id = 'B031310166'
        AND student_internship.internship_id = internship.internship_id
        AND internship.internship_session = session_tab.session_id;

if selected_date > now() or selected_date > end_date or selected_date < start_date then
signal sqlstate '45000'
set message_text = 'Selected Date is not in the range of the session or/and cant be future date';
else
	INSERT INTO dailylog (student_id,dailylog_status, dailylog_date, dailylog_title, dailylog_content, dailylog_img) 
    VALUES (user_id,'SICK_LEAVE', selected_date, title, log_content, img);
end if;
END ;;
DELIMITER ;
