CREATE DEFINER=`root`@`localhost` PROCEDURE `get_list_students`(lect_id varchar(30))
BEGIN

select lecturer.lecturer_id, student.student_name, student.student_id, internship.internship_title,
company_location.location_address, company.company_name, session_tab.session_id
from lecturer
