CREATE DEFINER=`root`@`localhost` PROCEDURE `get_weekends`(stud_id varchar(30))
BEGIN
	declare comp_id varchar(100);
    
	select company.company_id into comp_id from company, company_location, internship, student_internship
	where student_internship.internship_id = internship.internship_id
	and internship.internship_location = company_location.location_id
	and company_location.company_id = company.company_id
	and student_internship.student_id = stud_id;
    
    select weekends.weekend_day from weekends, company, company_weekend
	where company.company_id = company_weekend.company_id
	and company_weekend.weekend_id = weekends.weekend_id
	and company.company_id = comp_id;
    
END ;;
