CREATE DEFINER=`root`@`localhost` PROCEDURE `user_login`(matricNo varchar(50), password_input text,out usertype varchar(25))
BEGIN
declare student_count int;
declare company_count int;
declare lecture_count int;
declare company_emp_count int;

SELECT 
    COUNT(*)
INTO student_count FROM
    student
WHERE
    student_id = matricNo
        AND student_password = password_input;
SELECT 
    COUNT(*)
INTO lecture_count FROM
    lecturer
WHERE
    lecturer_id = matricNo
        AND lecturer_password = password_input;
SELECT 
    COUNT(*)
INTO company_count FROM
    company
WHERE
    (company_username = matricNo
        OR company_name = matricNo)
        AND company_password = password_input;
SELECT 
    COUNT(*)
INTO company_emp_count FROM
    company_employee
WHERE
employee_id = matricNo
        AND employee_password = password_input;



if(student_count > 0) then
select u.user_name
    into usertype
	from student s, user_type u
	where s.user_type = u.user_type_id
	and s.student_id = matricNo and s.student_password = password_input;
elseif(lecture_count > 0) then
	select u.user_name
    into usertype
	from lecturer l, user_type u
	where l.user_type = u.user_type_id
	and l.lecturer_id = matricNo and l.lecturer_password = password_input;
elseif(company_count > 0) then
	select u.user_name
    into usertype
	from company c, user_type u
	where c.userType = u.user_type_id
	and (company_username = matricNo or company_name = matricNo) and company_password = password_input;
    elseif(company_emp_count>0) then
    select u.user_name
    into usertype
	from company_employee ce, user_type u
	where ce.user_type = u.user_type_id
	and ce.employee_id = matricNo and ce.employee_password = password_input;
else
	signal sqlstate '45000' set message_text = 'Username or Password in incorrect';
end if;


END ;;
DELIMITER ;
